import React from 'react';
import './App.css';

import HelloWorld from './components/HelloWorld';
import Select from 'react-select';
import formatGroupLable from './components/eventSelect';
import options from './components/eventSelect';
import { groupStyles, groupBadgeStyles } from './components/eventSelect';

const App = () => {
    return (
        <div className="main">
            <HelloWorld/>
            <HelloWorld/>    
            <Select
                defaultValue={options[1]}
                options={options}
                formatGroupLabel={formatGroupLabel}
            />   
        </div>
    );
}

export default App;
